export default function Skills(){
    const skills=[{
            name:'HTML5',
            des:'About how much i have practised it and how much i known about it.',
            progress:90
        },
        {
            name:'CSS3',
            des:'About how much i have practised it and how much i known about it.',
            progress:80
        },
        {
            name:'ES6',
            des:'About how much i have practised it and how much i known about it.',
            progress:75
        },
        {
            name:'REACT',
            des:'About how much i have practised it and how much i known about it.',
            progress:80
        },
        {
            name:'EXPRESS',
            des:'About how much i have practised it and how much i known about it.',
            progress:65
        },
        {
            name:'NODE',
            des:'About how much i have practised it and how much i known about it.',
            progress:70
        },
        {
            name:'SQL',
            des:'About how much i have practised it and how much i known about it.',
            progress:85
        },
        {
            name:'FIGMA',
            des:'About how much i have practised it and how much i known about it.',
            progress:60
        },
        {
            name:'NEXT',
            des:'About how much i have practised it and how much i known about it.',
            progress:40
        },
        {
            name:'PYTHON',
            des:'About how much i have practised it and how much i known about it.',
            progress:70
        }
        
    ]
    return(
        <div className='skillsection'>
            <b style={{fontSize:'10vh'}}>Skills</b><hr/>
            <section>
                {skills.map((instance)=>
                    <div>
                        <h1>{instance.name}</h1>
                        <p>{instance.des}</p>
                        <div className="progress-bar">
                            <div className="progress-fill" style={{width: `${instance.progress}%`}}></div>{instance.progress}%
                        </div> 
                    </div>
                )}
            </section>
        </div>
    )
}
